import React from "react";

function About() {
  return (
    <div className="p-5 text-center bg-body-tertiary">
      <div className="container py-5">
        <h1 className="text-body-emphasis">About</h1>
        <p className="col-lg-8 mx-auto lead">
          Welcome to our website! We are dedicated to providing you with the best
          experience and information.
        </p>
        <p className="col-lg-8 mx-auto lead">Feel free to explore and discover everything we have to offer.</p>
      </div>
    </div>
  )
}

export default About;
